import Vue from 'vue'
import VueRouter from 'vue-router'
import HomePage from '@/pages/home/Home.vue'
import list from '@/pages/list/list.vue'

Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    name: 'Home',
    component: HomePage
  },
  {
    path: '/list',
    component: listPage
  }

]

const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
})

export default router
